import React, { useState } from 'react';
import Movie from './Movie';

const MovieList = () => {
    const [movies, setMovies] = useState([
        {
            name: 'Harry Potter',
            price: '$10',
            id: 1234
        },
        {
            name: 'Game of Thrones',
            price: '$10',
            id: 1235
        },
        {
            name: 'Inception',
            price: '$10',
            id: 1236
        }
    ]);

    return (
        <div>
            {movies.map(movie => (
                <Movie key= {movie.id} name={movie.name} price={movie.price}/>
            ))}
        </div>

    )
}


export default MovieList
